import StyleGlobal from './styleGlobal.css'
import Initial from './paginas/initial/Inicial';

import{
  BrowserRouter as Router,
  Routes,
  Route 
} from "react-router-dom"



function App() {
  return (
    <>

    <Router>
      <Routes>
        <Route exact path='/' element={<Initial />}/>
      </Routes>
    </Router>



    </>
  );
}

export default App;
